import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header className="bg-gray-800 p-4 flex items-center justify-between">
      {/* Logo */}
      <div className="flex items-center">
        <img src="/logo.png" alt="Logo" className="h-10 w-10 mr-2" />
        <h1 className="text-white text-lg font-semibold">Your Website Name</h1>
      </div>

      {/* Navigation */}
      <nav className="flex">
        <Link to="/" className="text-white mr-4 hover:text-gray-300">Furniture</Link>
        <Link to="/" className="text-white mr-4 hover:text-gray-300">Shops</Link>
        <Link to="/" className="text-white mr-4 hover:text-gray-300">About Us</Link>
        <Link to="/" className="text-white hover:text-gray-300">Contact</Link>
      </nav>
    </header>
  );
}

export default Header;
